import React, { useState, useEffect } from "react";
import axios from "axios";

const testNftArtViewer = () => {
  const [nftArt, setNftArt] = useState(null);

  const fetchNftArt = async (url) => {
    const response = await axios.get(url);
    const metadata = response.data;

    setNftArt(metadata.image);
  };

  useEffect(() => {
    fetchNftArt("https://opensea.io/assets/ethereum/0x42069abfe407c60cf4ae4112bedead391dba1cdb/4687");
  }, []);

  return (
    <div>
      <img src={nftArt} alt="" />
    </div>
  );
};

export default testNftArtViewer;
